import styled from "styled-components";
export const PaginationPageWrapper  = styled.div`
    .paginationBttns {
        display: flex;
        justify-content: center;
        &> li {
            padding: 0.25rem;
            border: 1px solid #000;
            color: #000;
            &.paginationActive {
                color: red;
            }
            &.paginationDisabled > a {
                color: #ddd !important;
            }
        }
    }
`
